import { addDomain } from '@/api/table'

export default {
  data() {
    return {
      form: {
        domain: '',
        host: '',
        ttl: ''
      }
    }
  },
  methods: {
    onSubmit() {
      this.$refs.dataForm.validate((valid) => {
        if (valid) {
          addDomain(this.form).then(() => {
            this.dialogFormVisible = false
            this.$message({
              message: '添加成功',
              type: 'warning'
            })
          })
        }
      })
    },
    onCancel() {
      this.$message({
        message: 'cancel!',
        type: 'warning'
      })
    }
  }
}
